import * as React from "react";
import { Autocomplete, Stack, TextField } from "@mui/material"

export const CreateProduct = () => {
         return (
                  <>
                   <Stack spacing={2} sx={{ width: 300 }}>

      <Autocomplete
        freeSolo
        id="free-solo-2-demo"
        disableClearable
        options={tags.map((option) => option.title)}
        renderInput={(params) => (
          <TextField
            {...params}
            label="choose a category"
            InputProps={{
              ...params.InputProps,
              type: 'search',
            }}
          />
        )}
      />
    </Stack>
                  </>
         )
}

const tags = [
         { title: 'Art'},
         { title: 'Music'},
         { title: 'Photography'},
         { title: 'Collectibles'},
         { title: 'Domain'}
]
